import React, { useEffect } from 'react';
import { makeStyles } from '@material-ui/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Box from '@material-ui/core/Box';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import {Link} from 'react-router-dom';

import background from '../assets/bg.png'
import liebert from '../assets/liebert.png';

const useStyles = makeStyles(theme => ({
  articleContainer: {
    marginTop: "8vh",
    width: '75%',
    height: "100vh",
    justifyContent: "center",
    alignItems: "center",
    textAlign: "center",
    verticalAlign: "center",
  },
  brands: {
    marginTop: "1em",
    justifyContent: "center",
    alignItems: "center",
    display: "flex",
    flexWrap: "wrap",
  },
  brandName: {
    color: theme.palette.common.blue,
    margin: 0,
    fontSize: "2em",
    fontFamily: "Raleway",
    fontWeight: 0,
  },
  brandDesc: {
    color: theme.palette.common.gray,
    margin: 0,
    fontSize: "1em",
    fontFamily: "Raleway",
    fontWeight: 0,
  },
  logo: {
    margin: "2em"
  }
}));

const Home = () => {
  const classes = useStyles();

  useEffect(() => {
    document.body.style = `background-image: url("${background}")`;
  }, []);

  return (
    <>
      <Grid container spacing={0} alignItems="stretch" justifyContent="center" style={{height: "100%"}}>
        <Paper elevation={0} className={classes.articleContainer}>
          <Box className={classes.brands}>
            <Button component={Link} to="/" >
              <img alt="liebert" src = {liebert} className = {classes.logo}/>
            </Button>
            <Typography className={classes.brandName} component="p" >LIEBERT</Typography>
            <Typography className={classes.brandDesc} component="p" >{"\n"}LIEBERT2</Typography>
          </Box>
          <Box className={classes.brands}>
            <Typography className={classes.brandName}>SERESCO</Typography>
          </Box>
          <Box className={classes.brands}>
            <Typography className={classes.brandName}>FRESH-AIRE UV</Typography>
          </Box>
        </Paper>
      </Grid>
    </>
  );
};

export default Home;
